import '../../styles/Contact.css'

export default function Contact(){
    return(
        <div className="contact-container">
            <h1>Contact Me</h1>
            <form className="contact-form">
               <div className="mb-3">
                <label htmlFor="name" className="form-label">Name:</label>
               </div>
             </form>
        </div>
    )
}
